INSERT INTO `profile` (`id`, `profile_type`, `title`, `description`, `vision`, `mission`, `category`, `file_id`, `created_by`, `created_date`, `modified_by`, `modified_date`) VALUES
(3, 'Tentang Kami', 'Sejarah SD INPRES Ende 7', 'SD INPRES ENDE 7 adalah salah satu satuan pendidikan dengan jenjang SD yang sudah dikenal bagi kalangan masyarakat kota Ende khususnya di kelurahan Mautapaga, kecamatan Ende Timur, Kabupaten Ende, Provinsi Nusa Tenggara Timur. SDINPRES ENDE 7 didirikan pada tahun 1963, dalam menjalankan kegiatannya SD INPRES ENDE 7 berada di bawah naungan Kementerian Pendidikan dan Kebudayaan. Akreditasi B/No. SK Akreditasi :80/SK/BAP-S/M NTT/IX/2015, Tanggal 22-09-2015.<br><br><br> SD INPRES ENDE 7 terletak di Jln. Gatot Subroto, Kelurahan Mautapaga, Kecamatan Ende Timur, Kabupaten Ende, Provinsi Nusa Tenggara Timur, dengan kode pos 86317 Lokasinya di tengah kota Ende yang berdekatan dengan fasilitas umum seperti kantor-kantor pemerintahan yaitu kantor Bupati, Puskesmas Kota, kantor Dinas kesehatan, Departemen Agama, dan Kantor-kantor umum lainnya. <br><br> Peserta didik SD Inpres Ende 7 berasal dari 2 kelurahan, yaitu Kelurahan Mautapaga Kecamatan Ende Timur dan Kelurahan Tetandara Kecamatan Ende Selatan.<br><br> Jumlah peserta didik dari tahun ke tahun meningkat, animo masyarakat sangat tinggi pada saat penerimaan siswa baru. Tahun Pelajaran 2020/2021 SDI Ende 7 membimbing siswa-siswi sebanyak 240 orang yang terdiri dari 12 rombongan belajar. Memiliki tenaga Pendidik sebanyak14 orang (PNS), 4 orang (Non PNS), dan Tenaga Kependidikan sebanyak 5 orang ( non PNS ).<br><br> Kualitas sekolah Baik, hal ini dibuktikan dengan berbagai prestasi yang telah diraih oleh siswa-siswi SDI Ende 7 baik dibidang akademik maupun non akademik, dari tingkat kecamatan, kabupaten dan provinsi<br><br> Nilai rata-rata untuk setiap mata pelajaran untuk setiap kelas menunjukkan adanya peningkatan, Hasil lulusan Ujian Nasional untuk setiap tahun 100 %. Penerapan Kurikulum 2013 mulai berlaku tahun 2016/2017 pada kelas I dan kelas IV, sedangkan kelas II, III, V dan kelas VI masih berlaku Kurikulum Tingkat Satuan Pelajaran (KTSP)2006. Tahun Pelajaran 2017/2018 hingga sekarang penerapan kurikulum 2013 dari kelas I sampai kelas VI<br><br> Kegiatan ekstrakurikuler yang dikembangkan di SDInpres Ende 7 meliputi bidang: pramuka,olahraga dan kesenian. Selain kegiatan kurikuler dan ekstrakurikuler, sekolah mengembangkan kegiatan pembiasaan yang berfungsi sebagai ajeng kepedulian terhadap sesama dan penanaman karakter bangsa. <br><br> Kegiatan pembiasan yang biasa dilakukan adalah kegiatan kerohanian baik oleh kaum Katolik, Kristen maupun kaum Islam, kegiatan budaya peduli lingkungan, kegiatan rutin doa bersama setiap pagi dan 3S (senyum, sapa, salam). <br><br> Keunggulan lain SDInpres Ende 7 adalah memiliki sanggar seni yang dibentuk pada tahun 2006 dengan nama Sanggar Seni Bintang Kejora. Budaya seni yang diajarkan adalah budaya seni musik dan tari daerah Ende Lio.<br><br> Pengembangan dan peningkatan kompetensi guru telah dilaksanakan melalui kegiatan kelompok kerja guru, kelompok kerja kepala sekolah dan berbagai pelatihan. Kepala Sekolah sebagai agen pembelajaran terus berusaha untuk meningkatkan kompetensi, dengan mengimplementasikan berbagai hasil pelatihan baik di kabupaten, provinsi, mau pun tingkat nasional, melaksanakan kemitraan dengan sekolah lain.<br><br> Tahun 2014 seorang guru mendapat penghargaan sebagai guru teladan. Dan sejak tahun 2016 SD Inpres Ende 7 menjadi sekolah model.<br><br> Tersedianya berbagai fasilitas sekolah seperti ruang kelas yang nyaman, perpustakaan, lapangan olahraga dan lainnya. Demi peningkatan mutu pendidikan,dan ketercapainya visi dan misi sekolah, komite pun berperan penting dan bekerja sama dengan Pendidik dan Tenaga Kependidikandi SDInpres Ende 7.<br><br> Mata pencaharian orang tua siswa 55 % bermata pencaharian Pegawai Negeri, 5 % sebagai pengusaha, 30 % sebagai petani, dan 10 % Karyawan swasta.<br><br>', '', '', '', 10, '', '2021-12-16 22:42:04', NULL, NULL),
